function unstaticPosition (elem, newPosition = 'relative') {
  var st = window.getComputedStyle(elem);
  if (st.getPropertyValue('position') !== 'static')
    return elem;
  elem.style.position = newPosition;
  return elem;
}

module.exports = unstaticPosition;
